define("dojox/lang/aspect/profiler",["dojo","dijit","dojox"],function(dojo,dijit,dojox){dojo.provide("dojox.lang.aspect.profiler"),function(){var aop=dojox.lang.aspect,uniqueNumber=0,Profiler=function(title){this.args=title?[title]:[],this.inCall=0};dojo.extend(Profiler,{before:function(){this.inCall++||console.profile.apply(console,this.args)},after:function(){--this.inCall||0}}),aop.profiler=function(title){return new Profiler(title)}}()})